import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 九·六庚日己卯时断</p><p>六庚日生时己卯，胎生元命发因妻；</p><p>柱中有托逢庚旺，财禄丰盈福寿齐。</p><p>庚日己卯时，胎生元命。</p><p>庚金卯上受胎，见巳为生气印绶。</p><p>庚以乙为财，卯有旺乙，因妻发福。</p><p>若柱旺丁，生月带禄者，贵；有倚托者，富。</p><p>通生气财旺者，生财旺运者，俱贵。</p><p>庚子日己卯时，子卯相刑，忧伤妻子，子年月，贵。</p><p>丑未，官至三品。</p><p>一云破祖失土，大贵。</p><p>庚寅日己卯时，亥卯月，财星格，早荣早退。</p><p>午戌，三合官局，干透金水，行西北运，吉。</p><p>庚辰日己卯时，孤。</p><p>年月通木气及有倚托者，贵。</p><p>庚午日己卯时，刑破。</p><p>申子辰己酉丑，俱行东南运，贵。</p><p>寅午戌亥卯未，须得西北运为佳。</p><p>庚申日己卯时，卯月，财星格，不贵即富。</p><p>丑巳年月，翰林清贵，官至亚卿。</p><p>一云少贫，中年有小灾，克妻少子。</p><p>庚戌日己卯时，少孤母贱，中年贵。</p><p>卯酉辰丑月，官至公卿。</p><p>天元庚己卯时连，禄见文书富贵全；四柱无刑冲克破，贵人接引上青天。</p><p>庚日时逢己卯，财官运气亨通。</p><p>若无刑冲定褒封，有破中年不顺。</p><p>雁行六亲难靠，自成家计无穷。</p><p>时来发达显功名，自有高人引用。</p>",28),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","242卷 九·六庚日己卯时断.html.vue"]]);export{f as default};
